function reformatCartItems(nft) {
    return {
        "tokenId": nft.tokenId.toString(),
        "claimingType": nft.claimingType.toString(),
        "startRange": "0",
        "endRange": "0",
        "printDataBasic": {
            "printType": nft.printDataBasic.printType.toString(),
            "quantity": nft.printDataBasic.quantity.toString()
        }
    }
}

